import logo from './logo.svg';
import './App.css';
import React from 'react';
import {Layout} from "antd"

class App extends React.Component {
  state = {
    auth: false
  };

  renderContent = () => {
    if (!this.state.authed){
      return <div>This is login page</div>
    } else {
      return <div>This is the main page</div>
    }
  }

  render(){
    return (
      <div>
        app main page
      </div>
    )
  }
}

export default App;
